import React from 'react'

class User extends React.Component {
	constructor() {
		super();
		this.state = {name: 'Иван', surname: 'Иванов'};
	}

	render() {
		return <p>
			имя: {this.state.name}, фамилия: {this.state.surname}
		</p>;
	}
}

export default User;
